import React from 'react'
import Button from '../Button'

const LoginHeaderContent = () => {
    return (
        <div>
            <a>Aready have an account?</a>
            <Button text={'Log In'} style={{float:'right'}}/>
        </div>
    )
}

export default LoginHeaderContent
